function DetailedCurated(props) {
  console.log(props.location);
  return (
    <>
      <div className="flex flex-col min-h-screen overflow-hidden">
        <Header />
        <MainDetailCurated />

        <Footer />
      </div>
    </>
  );
}
export default DetailedCurated;
